B.B9=new A.qh("assets/images/profile.png","Sufian Musab","Grunnlegger og Arabiskl\xe6rer","Ustadh Sufian er utdannet Sivilokonom fra Norges Handelshoyskole i Bergen. Det var under et internship i Cairo at Sufian fikk dyp interesse for Arabisk som forte han til Jordan. Han fullforte programmet i klassisk arabisk hos Oasid Institute i Amman, Jordan (5/5 nivaer). Under hans opphold studerte han ogs\xe5 b\xf8ker i islamske vitenskap og fikk ljazah fra den ledende arabisk filologen Shaykh Ali Hani i grammatikk boken Al-Ajrumiyyah. Ustadh Sufian har siden utviklet et pensum for Norse studenter og undervist i to \xe5r i Norge.",null)
B.Ba=new A.qh("assets/images/profile3.png","Sohaib Ahmed","Utvikler","Sohaib jobber som utvikler for b\xe5de apper og nettsider. Vi lever i en digital verden, derfor er det ogs\xe5 viktig at Alif ogs\xe5 har en digital platfrom. Han og har hatt ansvaret til \xe5 bygge Alif sin nettside, slik at brukerne kan se informasjon og sende hendvendelser samtidig ogs\xe5 kunne registrere seg p\xe5 kurs.",null)
B.Bb=new A.qh("assets/images/profile2.png","Usman Andreas","Arabiskl\xe6rer",'Ustadh Usman har studert arabisk fra ung alder, og har alltid hatt en sterk forkj\xe6rlighet og fascinasjon for spr\xe4k generelt, og i sarlig grad det arabiske spr\xe5ket. Han har lingvistisk bakgrunn med utdanning fra UiO i Nordiske spr\xe5k, i tillegg til \xe0 ha studert en rekke andre klassiske s\xe4vel som moderne spr\xe5k, slik som latin, gresk, hebraisk, arameisk, persisk, fransk og italiensk m.fl. Han ble selv eksponert for den sakalte "naturmetoden" i Roma, da han studerte latin og gresk der ett \xe5r, og har siden vert en proponent for en mer levende tiln\xe6rming til spr\xe5klaring.',null)
