B.Bd=new A.lC("Fordypning i Kasus endelsers (\u0627\u0644\u0625\u0639\u0631\u0627\u0628)","Dette kurset er designet for studenter som kan ca 700+ arabiske ord, b\xf8ye substantiv og verb, kjenne til de 10 verbformene, skrive nominelle og verbale setninger. Tilsvarende studert niv\xe5 1 og niv\xe5 2 hos Alif (Eller studert 1-2 \xe5r med Ustadh Sufian eller Ustadh Uthman tidligere fra Rabita eller ICC). Her vil vi g\xe5 i dybden av Kasus endelsers (\u0627\u0644\u0625\u0639\u0631\u0627\u0628) og etter endt kurs studentene skal v\xe6re p\xe5 et viderekommen niv\xe5 hvor de kan lese tekster uten kasus endelser og selv kunne analysere grammatikken og vite hvilken \u0627\u0644\u0625\u0639\u0631\u0627\u0628 et ord skal ha, dette gjelder ogs\xe5 de fleste koran vers. Per 2023 er niv\xe5 3 delt i to med en egen klasse for spr\xe5kferdigheter hvor studentene kun snakker arabisk.","3","Tidspunkt: Torsdager: kl 18-21 (Ustadh Sufian og Ustadh Usman)","400 kr/mnd",!0,null)
B.Be=new A.lC("Anvendelse av arabisk grammatikk","P\xe5 dette niv\xe5et tar vi steget videre fra niv\xe5 1 og anvende ting vi har l\xe6rt p\xe5 forskjellige tekster. Kurset baserer seg p\xe5 mye praktisk anvendelse av kunnskapene av niv\xe5 1, slik at studentene l\xe6rer \xe5 ta med seg kunnskapene i hverdagen samt mange unntak til regler som arabisk grammatikk inneholder.","2","under opparbeidelse...","under opparbeidelse...",!1,null)
B.Bf=new A.lC("Fra lese til \xe5 forst\xe5 Koran","Dette kurset er designet for \xe5 ta studenter som kun kan lese Koran til \xe5 f\xe5 et ordforr\xe5d p\xe5 over 300+ ord og kjennskap til grunnleggende arabisk grammatikk s\xe5 studenten forst\xe5r en god del av det de leser i Koranen. Vi skal sammen analysere Surah Yusuf (vil g\xe5 over niv\xe5 1 og niv\xe5 2) s\xe5 studenten begynner \xe5 lese Koran fra et grammatisk perspektiv.","1","Tidspunkt: Klasse 1: Ustadh Sufian: Mandager kl 18-20. Klasse 2: Ustadh Usman: Tirsdager kl 19-21","400 kr/mnd",!0,null)
